import React, { useState } from "react";
import { ShoppingCart, Pill, Plus, Minus, Search, Calendar, BoxSelect, Package } from "lucide-react";

export function ProductList({ products, onAddToCart }) {
  const [quantities, setQuantities] = useState(
    products.reduce((acc, product) => {
      acc[product._id] = 1;
      return acc;
    }, {})
  );

  const handleQuantityChange = (id, change) => {
    setQuantities(prev => {
      const newValue = Math.max(1, (prev[id] || 1) + change);
      return { ...prev, [id]: newValue };
    });
  };

  const addToCart = (product) => {
    onAddToCart({
      ...product,
      quantity: quantities[product._id]
    });
  };

  return (
    <div className="mt-8">
      <div className="mb-6 flex justify-between items-center">
        <h2 className="text-2xl font-bold text-gray-800">Available Medicines</h2>
        <div className="relative">
          <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none">
            <Search className="text-gray-400" size={18} />
          </div>
          <input
            type="text"
            placeholder="Search medicines..."
            className="border border-gray-200 rounded-full py-2 pl-10 pr-4 focus:ring-2 focus:ring-indigo-500 focus:border-transparent outline-none transition"
          />
        </div>
      </div>

      {products.length === 0 ? (
        <div className="bg-white rounded-2xl p-12 text-center shadow-lg border border-gray-100">
          <Pill size={64} className="mx-auto text-gray-300 mb-4" />
          <h3 className="text-xl font-semibold text-gray-700 mb-2">No Medicines Available</h3>
          <p className="text-gray-500">Add some medicines to get started with your inventory.</p>
        </div>
      ) : (
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {products.map((product) => (
            <div
              key={product._id}
              className="bg-white rounded-2xl shadow-lg border border-gray-100 overflow-hidden transition hover:shadow-xl"
            >
              <div className="bg-gradient-to-r from-purple-50 to-indigo-50 p-4">
                <div className="flex justify-between items-start">
                  <span className="bg-indigo-600 text-white text-xs px-2 py-1 rounded-full uppercase font-semibold tracking-wider">
                    {product.category || "General"}
                  </span>
                  {product.stock < 10 && (
                    <span className="bg-red-100 text-red-600 text-xs px-2 py-1 rounded-full uppercase font-semibold tracking-wider">
                      Low Stock
                    </span>
                  )}
                </div>
                <div className="mt-4 flex justify-center">
                  <div className="bg-white p-3 rounded-full shadow-md">
                    <Pill size={32} className="text-indigo-600" />
                  </div>
                </div>
              </div>

              <div className="p-5">
                <div className="text-center mb-4">
                  <h3 className="font-bold text-lg text-gray-800 mb-1">{product.name}</h3>
                  <div className="text-indigo-600 font-bold text-xl">Rs. {product.price}</div>
                </div>

                <div className="grid grid-cols-2 gap-2 text-sm text-gray-600 mb-6">
                  <div className="flex items-center">
                    <Package size={14} className="mr-1" />
                    <span>Stock: {product.stock}</span>
                  </div>
                  <div className="flex items-center">
                    <Calendar size={14} className="mr-1" />
                    <span>Exp: {product.expiry}</span>
                  </div>
                  <div className="flex items-center col-span-2 truncate">
                    <BoxSelect size={14} className="mr-1 flex-shrink-0" />
                    <span className="truncate">{product.manufacturer || "Not specified"}</span>
                  </div>
                </div>

                <div className="flex items-center justify-between">
                  <div className="flex items-center border border-gray-200 rounded-lg overflow-hidden">
                    <button
                      className="p-2 bg-gray-50 hover:bg-gray-100 transition"
                      onClick={() => handleQuantityChange(product._id, -1)}
                    >
                      <Minus size={16} />
                    </button>
                    <span className="px-4 font-medium">{quantities[product._id] || 1}</span>
                    <button
                      className="p-2 bg-gray-50 hover:bg-gray-100 transition"
                      onClick={() => handleQuantityChange(product._id, 1)}
                    >
                      <Plus size={16} />
                    </button>
                  </div>

                  <button
                    className="bg-indigo-600 hover:bg-indigo-700 text-white px-4 py-2 rounded-lg transition flex items-center"
                    onClick={() => addToCart(product)}
                  >
                    <ShoppingCart size={16} className="mr-2" />
                    Add
                  </button>
                </div>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}
